window.bookSummaryJSON = "<p><b>If you didn’t listen to </b><b><i>Sidekick</i></b><b>, you’ve gotta listen to that first. Trust me. </b></p> <p><b>If you did...</b></p> <p>Wow. Who saw that coming? I know I didn’t. As you know, I’m the Red Raptor. Now that things have...changed, I’ve asked my friend Amy to help tell the story. No, seriously, she’s just a friend. I mean - I guess if it were up to me? But...no. </p> <p>Okay, so there’s a new threat - a bunch of punks called the Neon Knights. They’re causing mayhem, armed with some kind of plasma-photon-light weapons that I can’t even begin to understand, and as usual, I’ve gotta stop them. </p> <p>However, this time I’ve got help. That’s right, I formed my own superteam. One for the ages. </p> <p>But first, I’ve gotta do my shift at Big Frankie Junior’s. What? You like eating burgers, right? Well, someone has to cook them. </p> <p>We can’t be heroes all the time. </p> <p><b>From number one Audible best sellers Jaime Castle and CJ Valin comes the next installment from the best new superhero universe, perfect for fans of both DC and Marvel. </b></p> <p><b>Actually, it’s for fans of anything superhero-related. You’re gonna like it. Promise.</b></p>"; 
